import React, {useRef} from "react"

export const TimeList = ({TimeDates, GetPositions}) => {
  const SelectRadio = (arg) => {
    GetPositions(arg.value);
  }

  return (
    <div id="TimeList">
      {

        TimeDates.length > 0
          ? TimeDates.map((time, index) => <label key={index}><input type="radio" name='time' value={time.datetime} checked={index===0} onChange={SelectRadio}/>{time.datetime}から<br/></label>)
          : <p>データがありません</p>
      }
    </div>
  )
}
